const Tile = (props) => {

    const { pic, name } = props;

    const handleClickEvent = () => {
        console.log('clicked' + name);
    }

    return ( 
        <div className="tile" onClick={handleClickEvent}>
            <img src={pic} className="tile-image" alt={name}/>
            <div className="tile-content">{name}</div>
        </div>
     );
}

export default Tile;
